import React from 'react';

import './App.css';
import Nav from './components/nav';
import Homepage from './components/homepage';
import Cart from './components/cart';
import Shop from './components/shop';
import {HashRouter} from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <Nav/>
      <Homepage/>
      <Shop/>
      <Cart/>
    </div>
  );
}

export default App;
